import { FC } from "react";
import style from './Home.module.scss';

const Home: FC = () => {
    return (
        <div className={style.home}>
            <div className={style.header}>
                <img src="./src/components/image/foto.jpg" alt="icon" />
                <img src="./image/foto.jpg" alt="icon" />
                <form action="#" className={style-serch}>
                    <button type="submit" className={style.btn}>
                        <img className={style.img} src="" alt="foto" />
                    </button>
                    <input className={style.inputHeader} type="text" placeholder="Enter GitHub username"/>
                </form>
                
            </div>
        </div>
    );
};
export default Home;
